import React from "react";
import NavBar from "./components/Navbar";
import Home from "./components/Home";
import Footer from "./components/Footer";
import { Route, Switch } from "react-router";

const App = () => {
  return (
    <main>
      <BrowserRouter>
        <Switch>
          <Route path="/NavBar">
            <NavBar />
          </Route>
        </Switch>
          <Switch>
            <Route path="/Footer">
              <Footer />
            </Route>
          </Switch>
        <Switch>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </BrowserRouter>
    </main>
  );
};

export default App;
